<style>

    .container{
        position: relative;

    .default_icon{

        width: 100%;
        height: 100%;

        margin-top: 0%;
        margin-left: 0%;

    .container:hover .default_icon{

    }

    .container:hover .hover_icon{
        display: block;
    }


</style>
